import React from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import CardItem from '../components/CardItem';

function Cards() {
  return (
    <Container className='cards'>
      <h1>Best Places to Visit in Asia!</h1>
      <Container fluid className='cards__container'>
        <Row className='cards__wrapper'>
          <Col md={6} lg={4}>
            <CardItem
              src='https://imgs.search.brave.com/Lss0Fs7SBvOsRV4nXcPv_TejIDPCZaJ3P5ycuk0E9G8/rs:fit:860:0:0/g:ce/aHR0cHM6Ly9jNC53/YWxscGFwZXJmbGFy/ZS. . .'
              text='Maldives'
              label='Travel With JongDer'
              path='/Maldiv'
            />
          </Col>
          <Col md={6} lg={4}>
            <CardItem
              src='https://imgs.search.brave.com/ZCBXBDfwfMtLiu1wWW2kevj3kqUtAndx7kKa4yw7uEw/rs:fit:860:0:0/g:ce/aHR0cHM6Ly9jZG4u/d2FsbHBhcGVyc2Fm/YXJpL. . .'
              text='Tokyo'
              label='Travel With JongDer'
              path='/ToyKo'
            />
          </Col>
          <Col md={6} lg={4}>
            <CardItem
              src='https://imgs.search.brave.com/fcGHVqeaO8C86rEbbTw4Uo4SY5F4YzTTkRXh5Y_VjAs/rs:fit:500:0:0/g:ce/aHR0cHM6Ly9jNC53/YWxscGFwZXJmbGFy/ZS5jb20vd2FsbHBh/cGVyLzk3NC83NTkv/ODIwL3NlYS1ncmVl/bnMtaXNsYW5kcy10/cm9waWNzLXdhbGxw/YXBl. . .'
              text='Phuket'
              label='Travel With JongDer'
              path='/services'
            />
          </Col>
          <Col md={6} lg={4}>
            <CardItem
              src='https://www.telegraph.co.uk/content/dam/Travel/Destinations/Asia/China/Beijing/EG4N7_Beijing_Travel.jpg?imwidth=960'
              text='why Beijing should be on your radar'
              label='Travel With JongDer'
              path='/sign-up'
            />
          </Col>
        </Row>
      </Container>
    </Container>
  );
}

export default Cards;
